import React, { useState } from "react";
import { Container, Typography, Box, Avatar, Paper } from "@mui/material";
import tictactoeimage from "../assets/Tictactoe.jpeg";
import { Link } from "react-router-dom";
import "../styles/TicTacToe.css";

export default function TicTacToe() {
  const initialBoard = [
    [null, null, null],
    [null, null, null],
    [null, null, null],
  ];
  const [value, setValue] = useState("u");
  const [board, setBoard] = useState(initialBoard);

  const handleCellClick = (rowIndex, cellIndex) => {
    const newBoard = [...board];
    const newRow = [...newBoard[rowIndex]];
    // newRow[cellIndex] = setValue = "p";
    newRow[cellIndex] = "X";
    newBoard[rowIndex] = newRow;
    setBoard(newBoard);
  };

  return (
    <Container maxWidth="md" sx={{ marginTop: "2rem" }}>
      <Typography variant="h3" gutterBottom>
        {/* Sola Akinbode */}
      </Typography>
      <Box
        sx={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          marginBottom: "2rem",
        }}
      >
        <Avatar
          src={tictactoeimage}
          sx={{ width: 150, height: 150, marginRight: "1rem" }}
          alt="Picture"
        />
        <Typography
          variant="h4"
          style={{ color: "green", fontStyle: "italic" }}
        >
          Tic-Tac-Toe
        </Typography>
      </Box>
      <Paper sx={{ padding: "2rem" }}>
        <div className="board">
          {board.map((row, rowIndex) => (
            <div className="row" key={rowIndex}>
              {row.map((cell, cellIndex) => (
                <button
                  className={`cell ${cell}`}
                  key={cellIndex}
                  onClick={() => handleCellClick(rowIndex, cellIndex)}
                >
                  {value}
                </button>
              ))}
            </div>
          ))}
        </div>
      </Paper>
    </Container>
  );
}
